function demo_hierarchical_NLPCA_StarData
% Hierarchical nonlinear PCA (NLPCA) with standard bottleneck architecture
%
% data set: spectral data of stars
%           available at: http://www.cida.ve/~stock/paper1/
% 
% Here, PCA pre-processing and linear weight initialisation is used to 
% start NLPCA with the linear solution of PCA.
% Even though reducing the dimensionality by PCA in advance is often very 
% helpful, in the example PCA is not used for dimensionality reduction. 
% The dimensionality is still 19 but the data space is rotated by PCA. 
% Plotted is the data space of the first three principal components 
% but the identified nonlinear components lie originally in the full 
% 19 dimensional space.
%
% see also: Scholz and Vigario. Proceedings ESANN, 2002
%           www.nlpca.org

% Author: Matthias Scholz
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%

% get star sepectral data
    data_all=get_star_data;  % data are attached below
    data=data_all(:,2:20);   % spectral values only
    data=data';
     
    % class labels (spectral type groups) for plotting with different colours/symbols
    group_raw=data_all(:,end)';
    group=zeros(size(group_raw));
    group(group_raw==3)=1; % late
    group(group_raw==2)=2; % early
    group(group_raw==4)=3; % very late
    group(group_raw==1)=5; % very early
    group(group_raw==0)=4; % stars which can not be classified exactly because of the blue and red spectrum
    group(group_raw==6)=6; % stars with very low temperature

    
% component extraction

    [pc,net,network]=nlpca(data,3,'pre_pca','yes',...
                                 ... % 'pre_unit_variance','yes',... % not recommended for the star data
                                 'units_per_layer'      ,[12, 8, 3, 8, 12]   ,... % optional (to reduce data-dim from 19 to 12)
                                 'weight_initialization','set_weights_linear',...
                                 'weight_decay_coefficient',0.01,...
                                 'data_class',group,...
                                 'max_iteration',1000);
                      
% plot component

    nlpca_plot(network) % use 'network' instead of 'net' to get the PCA transformation
    title('{\bf hierarchical NLPCA} (spectral data of stars)')
    axis equal
    axis on
    set(gca,'XTickLabel',[])
    set(gca,'YTickLabel',[]) 
    set(gca,'ZTickLabel',[]) 
    xlabel('PC 1')
    ylabel('PC 2')
    zlabel('PC 3')
     
    
% save result

    % save nlpca_star_spectral_data   net network

     
    
    
    
